  \"graphic-preview-description\",\n\t\t\"value\": \"The effects of the tsunami at
  Wuhring, Flores Island. Although the tsunami heights at this location were lower
  than elsewhere (only about 3.5 m) the waves swept entirely over the 400 m by 200
  m peninsula inundating the densely populated community of Wuhring and killing 100.
  Here the damage was not as severe as on Babi Island. The waves left conical sand
  accumulations inside the houses, and at some locations the depth of the debris was
  about one meter.\"\n\t},\n\t{\n\t\t\"key\": \"frequency-of-update\",\n\t\t\"value\":
